import { checkRuntimeBytecodeSize } from "../../src/evm/helper";
import test from "ava";
import { POLY_MAX_CONTRACT_CODE_SIZE_IN_BYTE } from "../../lib/methods/constant";

const testData = [
  {
    bytecode:
      "",
    runtimeByteCodeSize: 35677,
    limit: POLY_MAX_CONTRACT_CODE_SIZE_IN_BYTE,
  },
  {
    bytecode:
      "",
    runtimeByteCodeSize: 229,
    limit: 200,
  },
  {
    bytecode:
      "",
    runtimeByteCodeSize: 229,
    limit: 200,
  },
  {
    bytecode:
      "",
    runtimeByteCodeSize: 1795,
    limit: 1000,
  },
  {
    bytecode:
      "",
    runtimeByteCodeSize: 63,
    limit: 62,
  },
  {
    bytecode:
      "0x6080604052348015600f57600080fd5b50603f80601d6000396000f3fe6080604052600080fdfea26469706673582212202d5d7853bd40458bf66737cf5128e8c8b30ce633a210391d8f7b3c2f014c703164736f6c63430007010033",
    runtimeByteCodeSize: 63,
    limit: 62,
  },
];

test("checkRuntimeBytecodeSize", (t) => {
  testData.map((data, index) => {
    const [exceedLimit, size] = checkRuntimeBytecodeSize(
      data.bytecode,
      data.limit
    );
    t.is(exceedLimit, true);
    if (index === 4) {
      // testcase 4 is a special contract which only contains constructor
      // in such case, the checkRuntimeBytecodeSize func might take the constructor length
      // as runtimeBytecode length for mistake
      // however, in real world, we only check contract create bytecode larger than 24k,
      // there should be no way for a real contract that is both larger than 24k and also contains only constructor.
      t.not(size, data.runtimeByteCodeSize);
    } else {
      t.is(size, data.runtimeByteCodeSize);
    }
  });
});
